        #region 闸机加密

        /// <summary>
        /// 闸机加密
        /// </summary>
        /// <param name="origin">原数据</param>
        /// <param name="key">密钥</param>
        /// <returns></returns>
        public static string Encrypt(string origin, string key)
        {
            if (string.IsNullOrWhiteSpace(key)) return origin;
            try
            {
                var provider = GetProvider(key);
                var bytes = Encoding.UTF8.GetBytes(origin);
                var stream = new MemoryStream();
                var cryptoStream = new CryptoStream(stream, provider.CreateEncryptor(), CryptoStreamMode.Write);
                cryptoStream.Write(bytes, 0, bytes.Length);
                cryptoStream.FlushFinalBlock();
                var securtyString = BitConverter.ToString(stream.ToArray(), 0).Replace("-", string.Empty).ToLower();
                stream.Close();
                return securtyString;
            }
            catch (Exception ex)
            {
                throw;
            }
        }
        private static DESCryptoServiceProvider GetProvider(string sKey)
        {
            var provider = new DESCryptoServiceProvider
            {
                Padding = PaddingMode.PKCS7,
                Mode = CipherMode.CBC,
                Key = Encoding.UTF8.GetBytes(sKey.Substring(0, 8)),
                IV = new byte[] { 0, 0, 0, 0, 0, 0, 0, 0 }
            };
            return provider;
        }
