        #region 厦门会展二标段劳务实名制网站签名
        /// <summary>
        /// 获取厦门会展二标段劳务实名制网站加密
        /// </summary>
        /// <param name="appSecret">密钥</param>
        /// <param name="input">参数</param>
        /// <returns></returns>
        public static string GetXiamenSectionTwoSign(string appSecret, object input)
        {
            var propInfos = input.GetType().GetProperties().ToList();
            propInfos.Sort((m, n) => string.CompareOrdinal(m.Name, n.Name));//按字段名称ASCII码升序排列
            //var keyValuePairs = propInfos.Select(m => new KeyValuePair<string, object>(m.Name, m.GetValue(input))).ToList();
            var beforeMd5 = new StringBuilder();
            beforeMd5.Append(appSecret);
            foreach (var propertyInfo in propInfos)
            {
                beforeMd5.Append(propertyInfo.Name);
                beforeMd5.Append(propertyInfo.GetValue(input));
            }
            beforeMd5.Append(appSecret);
            return MD5Encrypt.BuildSign(beforeMd5.ToString()).ToUpper();
        }

